import React from 'react';
import '../../styles/footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <h2>Footer Title</h2>
        <p>This is a beautiful curved footer section.</p>
      </div>
    </footer>
  );
};

export default Footer;
